import React from "react";

function LoginPage() {
    return (
        <div style={{ padding: 20}}>
            <h1>Login</h1>
            <input placeholder="Username" />
            <input placeholder="Password" />
            <button>Login</button>
        </div>
    );
}
export default LoginPage;
